import React, { useState } from 'react'

export const MenuBar = ({ pages , handleChangePage }) => {

    const listItems = pages.map(page => {
        return <button 

            className='menuOption'
            key={page.id}
            type='button' 
            value={page.name}    
            submit={(e) => {
                e.preventDefault();
                handleChangePage(page.id)
            }}
        />
    });

    return (
        <div className='menuBar'>
            {listItems}
        </div>
    );
}
